&lt;p&gt;&lt;a href="http://www.flickr.com/people/johanbrits/"&gt;Johan Brits&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/johanbrits/5065176413/" title="hippopotamus charge"&gt;&lt;img src="http://farm5.static.flickr.com/4110/5065176413_512da601b8_m.jpg" width="240" height="170" alt="hippopotamus charge" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;Photo taken with a Nikon D300 and 200-400 mm F4 Nikon lens in Chobe Botswana&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/ana-carbajo/"&gt;Ana Lobi&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/ana-carbajo/5111876692/" title=""&gt;&lt;img src="http://farm5.static.flickr.com/4086/5111876692_69335693fc_m.jpg" width="160" height="240" alt="" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;baby hyaena&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/bdinphoenix/"&gt;bdinphoenix&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/bdinphoenix/5117654433/" title="tree roots"&gt;&lt;img src="http://farm2.static.flickr.com/1147/5117654433_5a91794b9c_m.jpg" width="159" height="240" alt="tree roots" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;Our guide at Victoria Falls points out the tree roots that have wrapped itself around the trunk of the tree.  He said this will eventually kill this tree.&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/bdinphoenix/"&gt;bdinphoenix&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/bdinphoenix/5158878851/" title="Victoria Falls"&gt;&lt;img src="http://farm5.static.flickr.com/4011/5158878851_05d96e7845_m.jpg" width="240" height="159" alt="Victoria Falls" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;The Victoria Falls or Mosi-oa-Tunya (the Smoke that Thunders) is a waterfall located in southern Africa on the Zambezi River between the countries of Zambia and Zimbabwe. The falls are some of the largest in the world.&lt;/p&gt;

